import { Container, Row, Col } from "react-bootstrap";
import { MailchimpForm } from "./MailchimpForm";
import logo from '../assets/img/logosmall.png';
import navIcon1 from "../assets/img/nav-icon1.svg";
import navIcon2 from "../assets/img/nav-icon2.svg";
import navIcon3 from "../assets/img/nav-icon3.svg";
import navIcon4 from "../assets/img/nav-icon4.svg";

export const Footer = () => {
  return (
    <footer className="footer">
      <Container>
        <Row className="align-items-center">
          <MailchimpForm />
          <Col size={12} sm={6}>
            <img src={logo} alt="Logo" />
          </Col>
          <Col size={12} sm={6} className="text-center text-sm-end">
            <div className="social-icon">
              <a href="https://www.linkedin.com/in/hao-yu-625118171/"><img src={navIcon1} alt="Icon" /></a>
              <a href="https://drive.google.com/file/d/1PemJWNjTuecs3hXxfoZQeE3MtT3ENmCX/view?usp=sharing"><img src={navIcon2} alt="Icon" /></a>
              <a href="https://www.instagram.com/uuuhaoo/?utm_source=qr"><img src={navIcon3} alt="Icon" /></a>
              <a href="https://www.youtube.com/@haoyu6628/featured"><img src={navIcon4} alt="Icon" /></a>
            </div>
            <p>Copyright 2022. Hao Yu All Rights Reserved</p>
          </Col>
        </Row>
      </Container>
    </footer>
  )
}
